import "core-js/modules/es.array.push.js";
export default {
  computed: {
    companyData() {
      return this.$store.getters["phone/getCompanyData"];
    }
  },
  watch: {
    companyData() {
      this.chekCompany();
    },
    $route(to) {
      if (to.path.includes("CompanyApp")) {
        this.chekCompany();
      }
    }
  },
  methods: {
    chekCompany() {
      if (this.companyData) {
        this.$router.push("/Phone/CompanyApp/Menu");
      } else {
        this.$router.push("/Phone/CompanyApp/Main");
      }
    },
    keydown(e) {
      if (e.keyCode === 8) {
        setTimeout(() => {
          this.$router.push("/Phone");
        }, 5);
      }
    }
  },
  mounted() {
    this.chekCompany();
    window.addEventListener("keydown", this.keydown);
  },
  beforeUnmount() {
    window.removeEventListener("keydown", this.keydown);
  }
};
